var socket;function socket_start(o){if(o){socket_check()||(console.log("WebSocket Started"),socket=socket_server(o));try{socket.onopen=function(o){console.log("socket initialized")},socket.onmessage=function(o){var e=JSON.parse(o.data);console.log(e)},socket.onclose=function(o){console.log({closed:socket})}}catch(e){console.log(e)}}else console.error("Host websocket empty")}function socket_server(o){if(o){if(console.log("Socket Initialized"),window.EventSource)e=new WebSocket(o);else var e=new EventSource(o);return e}console.error("Host websocket empty")}function socket_stop(){null!=socket&&(console.log("WebSocket Stopped"),socket.close(),socket=null)}function socket_check(){return socket}